%[text] # uDALES urban surface creation
%[text] uDALES supports several manners to create urban surfaces. It is possible to run uDALES without specifying an urban surface, in which case a flat terrain is assumed. In most cases however, an urban surface will be specified. uDALES contains a number of functions in the [**udgeom**](internal:H_3c00) package that aid geometry generation:
%[text] - [**udgeom.createFlatSurface**](internal:H_81c4). This function creates a flat surface. The main reason for using this function is to be able to discretise the surface in as many facets as possible in case heterogeneous boundary conditions are required.
%[text] - [**udgeom.createCanyons**](internal:H_2c08). This function creates one-dimensional street canyons.
%[text] - [**udgeom.createCubes**](internal:H_3940). This function creates cubes, either a single one or an array of cubes.
%[text] - [**udgeom.createRealistic**](internal:H_9762). This function creates a realistic urban surface based on an stl file that contains the buildings. The function adds the ground surface. \
%[text] **The live matlab file of this tutorial can be found in the repository in the folder /docs/tutorial\_mlx.**
%%
%[text] ## Initialising udbase
%[text] 
%[text] **Note that the uDALES/tools/matlab path must be added via the Set Path button in order to use the udgeom package. Alternatively, it can be added using the addpath function inside the script (done here).**
% preamble
clear variables
close all

% add the uDALES matlab path
addpath('C:\Users\mvr\OneDrive - Imperial College London\codes\uDALES\u-dales\tools\matlab')
%%
%[text] %[text:anchor:H_3c00] ### The udgeom class
%[text] The udgeom class contains the uDALES urban surface. It is the output of the geomety creation routines mentioned above. The class can load STL files, display the geometry and save to STL files as shown below.
help udgeom.udgeom %[output:1f0eb69f]
geom = udgeom.udgeom();    % create udgeom instance. 
methods(geom);             % show the methods the class contains %[output:9ae5d960]
%[text] These methods can be used as follows
help geom.load %[output:8c44c37d]
help geom.save %[output:93eb888d]
help geom.show %[output:0e3dd4ed]
%[text] Here is a simple example on how to use this class:

geom.load('uDALES.stl')    % load an STL file from the current directory (can be changed in constructor)
geom.show();               % show the geometry %[output:5412fae1]
xlabel('x [m]');  %[output:5412fae1]
ylabel('y [m]') %[output:5412fae1]
%[text] Another way is to show the outline.
help geom.show_outline %[output:451c9ce7]
%[text] Here is a simple example on how to use this method:
geom.show_outline();               % show the geometry outline %[output:6ba4af17]
xlabel('x [m]');  %[output:6ba4af17]
ylabel('y [m]') %[output:6ba4af17]
%%
%[text] %[text:anchor:H_81c4] ### udgeom.createFlatSurface
%[text] This function creates flat surfaces
help udgeom.createFlatSurface %[output:879ccf12]
%[text] See below for an example how to use this function.
% domain size
xsize = 96;           % [m]
ysize = xsize;        % [m]
edgelength = xsize/8; % [m] 

geom = udgeom.createFlatSurface(xsize, ysize, edgelength);
geom.show;  %[output:5d1ad864]
xlabel('x [m]');  %[output:5d1ad864]
ylabel('y [m]') %[output:5d1ad864]
%%
%[text] %[text:anchor:H_2c08] ## udgeom.createCanyons
%[text] This function creates one-dimensional street canyons
help udgeom.createCanyons %[output:1e3fbca6]
%[text] See below for an example how to use this function.
% domain size
xsize = 96;       % domain size in x-direction
ysize = 96;       % domain size in y-direction

% canyon properties
B = 12;           % building width
H = 16;           % building height
W = 12;           % street width
shift = 20;       % make the canyons start a distance from the west-boundary of the domain. 
                  % Note this makes the domain larger in the x-direction.
edgelength = 6;   % facet size
rotate90 = false; % default value

geom = udgeom.createCanyons(xsize, ysize, B, W, H, shift, edgelength, rotate90);
geom.show;  %[output:70b98b19]
xlabel('x [m]');  %[output:70b98b19]
ylabel('y [m]') %[output:70b98b19]
%%
%[text] %[text:anchor:H_3940] ## udgeom.createCubes
%[text] This function creates cubes, either a single one or an array of cubes.
help udgeom.createCubes %[output:3928fe8e]
%[text] See below for an example how to use this function.
% domain size
xsize = 96; 
ysize = 96; 

% cube length in each direction
Hx = 16; 
Hy = 16; 
Hz = 16; 

% canyon length in each direction
Cx = 8; 
Cy = 8; 

% geometry type
%     S: single cube
%    AC: aligned cubes
%    SC: staggered cubes

geom_type = 'SC';

edgelength = 8;

geom = udgeom.createCubes(xsize, ysize, Hx, Hy, Hz, Cx, Cy, geom_type, edgelength);
geom.show; 
xlabel('x [m]'); 
ylabel('y [m]')
%%
%[text] %[text:anchor:H_9762] ## udgeom.createRealistic
%[text] This function creates a realistic urban surface based on an stl file that contains the buildings. The function adds the ground surface.
help udgeom.createRealistic %[output:38617d3f]
%[text] See below for an example how to use this function.
% stl file containing buildings only
stlfile = 'uDALES.stl';

% original domain size
xsize_og = 256; 
ysize_og = 128; 

% example translation to make domain larger in x direction
shift = [20 0 0];

% ground facet size
edgelength = 16;

geom = udgeom.createRealistic(stlfile, xsize_og, ysize_og, shift, edgelength);
geom.show; 
xlabel('x [m]'); 
ylabel('y [m]')

